import React, { Component } from "react";
import Bullet from "./Bullet.js";

class Page extends Component {
  constructor(props) {
    super(props);

    const { bullet } = this.props;
    this.setState({ bullet });
  }

  render() {
    return (
      <div className="container">
        <h1 className="display-1">{ this.state.bullet.content }</h1>
        <h1 className="display-5">{ this.state.bullet.note }</h1>
        <hr></hr>
        {
          this.state.children.map(child =>
            <Bullet bullet={ child }></Bullet>
          )
        }
      </div>
    )
  }
}

export default Page;
